import React from "react";

function Header() {
  return (
    <div class="header">
        <div class="complete-navbar" id="complete-navbar">
            <li class="navbar">
                <a id="header-content">Makonis</a>
                <a id="home" href="./">Home</a>
            </li>
        </div>
    </div>
  );
}

export default Header;
